import React from "react";

const courses = [
    {
        _id: "123",
        title: "CS4550"
    },
    {
        _id: "234",
        title: "CS4500"
    },
    {
        _id: "345",
        title: "CS3200"
    }
]
const CourseListComponents = ({instructor, term}) => {
    return (
        <div>
        <h1>Course List(for{instructor}) {term}</h1>
        <table>
            <tr><td>Course1</td></tr>
            <tr><td>Course2</td></tr>
            <tr><td>Course3</td></tr>
            {
                courses.map(function () {
                    return ""
                })
            }
        </table>
        </div>
    )
}

export default CourseListComponents;
